response.about:
Зачем это вам?
Вы курильщик со стажем? Хотите бросить курить или курить и меньше приносить вред своему здоровью, но не получается? А может просто ищете, что подарить другу, курильщику?

Вот здесь вам и пригодятся электронные сигареты. Они полностью имитируют курение, но при этом полностью избавят человека от всех негативных последствий этого процесса.
Что это?
- полностью безопасный аналог обычной сигареты;
- отличный подарок для заядлого курильщика;
- гарантированный способ бросить курить;
- стильная вещь;
- разработка, основанная на инновационных медицинских технологиях. В этом случае, новейшие научные достижения используются на благо человечества.
Курите на здоровье!
Электронные сигареты не содержат никаких вредных соединений и канцерогенов. От них нет дыма, вы никому не помешаете, если закурите прямо на рабочем месте, дома при ребенке или в общественном месте. Электронные сигареты не содержат ни цианида, ни аммиака, ни бензола - ничего, что есть в обычных сигаретах - только никотин и вода! 
 Посмотрите, что изменится в Вашей жизни с использованием электронной сигареты.

Благодаря абсолютной имитации курения Вы сможете бросить курить навсегда или замените обычные сигареты! Все зависит от Вашего желания. Действенные средства для этого теперь есть - это электронные сигареты
